import React from "react";
import sea from "../img/sea.webp";
import workout from "../img/workout.svg";

export default function Showcase() {
    return(
        <section className="relative">
        <div>
        <div className="relative w-full relative h-screen flex">
            <img src={sea} className="w-full h-full object-cover absolute mix-blend-overlay" />
        <div className="py-60 px-20">
            <h1 class="text-left text-white text-6xl ">Unleash your healthiest self</h1>
        </div>  
        <div className="p-10 flex-auto w-1/2 invisible md:visible">
        <img src={workout} className="p-10 flex-auto w-1/2" alt=""></img>  
        </div>   
        </div>
        </div>
        </section>
    )
}
